libs.content:
find_library(sdl2_library_temp
	names sdl2
	hints
	$env{sdl2dir}
	path_suffixes lib64 lib
	paths ${sdl2_search_paths}
)

find_library(sdl2main_library
			names sdl2main
			hints
			$env{sdl2dir}
			path_suffixes lib64 lib
			paths ${sdl2_search_paths}
		)

find_library(sdl2net_library
	names sdl2_net
	hints
	$env{sdl2netdir}
	path_suffixes lib64 lib
	paths ${sdl2net_search_paths}
)
